import React, { Component } from 'react'

import {CardHeader, Card, IconButton, CardContent} from '@material-ui/core';

class Rating extends Component {
    render() {
        return (
            <Card raised={true} className='card-cont'>
            <CardHeader
                action={
                    <div>
                        <IconButton onClick = {()=> {this.handleLine()}}><img src={line ? lineIconSelected : lineIcon} style={{width:'25px'}} /></IconButton>
                        <IconButton onClick = {()=> {this.handleBar()}}><img src={bar ? barIconSelected : barIcon} style={{width:'25px'}}  /></IconButton>
                        <IconButton onClick = {()=> {this.handlePie()}}><img src={area ? areaIconSelected : areaIcon} style={{width:'25px'}}  /></IconButton>
                        <IconButton onClick = {()=> {}}><MoreVertIcon /></IconButton>
                    </div>
                }
                title="Parking Utilisation"
                titleTypographyProps={{variant:'h6' }}
                />
            <CardContent>
                <Chart ref="child" chartType={this.state.chartType} />
                <div className="card-footer">
                    <Button variant="contained" color="primary">Track the Parking status</Button>
                </div>
            </CardContent>
        </Card>
        )
    }
}

export default Rating
